INSERT INTO `chat_voice` VALUES (1958693780031393793, 'https://lxim.oss-cn-shenzhen.aliyuncs.com/alpaca/202508/22/08/68a7bf595640055e60a7e964.m4a', '123123321321。', 1958005652102651906, '2025-08-22 08:52:43');
INSERT INTO `chat_voice` VALUES (1958736630739755010, 'https://lxim.oss-cn-shenzhen.aliyuncs.com/alpaca/202508/22/11/68a7e74256404b06a0b7aa81.m4a', '要重新发，之前发的不行，地址不一样。', 1958005652102651906, '2025-08-22 11:42:59');
INSERT INTO `chat_voice` VALUES (1958782608851202049, 'https://lxim.oss-cn-shenzhen.aliyuncs.com/alpaca/202508/22/14/68a81214564019b70754c574.m4a', '我说话你听到吗？我说话你听到吗？', 1958379553043324930, '2025-08-22 14:45:41');
INSERT INTO `chat_voice` VALUES (1960693694798479361, 'https://lxim.oss-cn-shenzhen.aliyuncs.com/alpaca/202508/27/21/68af05ea88bc20ae1999ce37.m4a', '录个音，录个音，录个音。', 1958005652102651906, '2025-08-27 21:19:39');
INSERT INTO `chat_voice` VALUES (1961038146107924481, 'https://lxim.oss-cn-shenzhen.aliyuncs.com/alpaca/202508/28/20/68b046b688bce5a6cd4c462a.m4a', '你要授权，你要授权。', 1958005652102651906, '2025-08-28 20:08:23');
INSERT INTO `chat_voice` VALUES (1961038200709373953, 'https://lxim.oss-cn-shenzhen.aliyuncs.com/alpaca/202508/28/20/68b046c388bce5a6cd4c462b.m4a', '你拨打过来，你拨打过来，然后授权，然后再拨打就可以了。', 1958005652102651906, '2025-08-28 20:08:36');
INSERT INTO `chat_voice` VALUES (1961038872569765890, 'https://lxim.oss-cn-shenzhen.aliyuncs.com/alpaca/202508/28/20/68b0476388bce5a6cd4c462c.m4a', '在这边说什么会比较方便一点。', 1958005652102651906, '2025-08-28 20:11:16');
INSERT INTO `chat_voice` VALUES (1961039173913731074, 'https://lxim.oss-cn-shenzhen.aliyuncs.com/alpaca/202508/28/20/68b047ab88bce5a6cd4c462d.m4a', '你听不听得到我说话啊？', 1958005652102651906, '2025-08-28 20:12:28');
INSERT INTO `chat_voice` VALUES (1961039248492650498, 'https://lxim.oss-cn-shenzhen.aliyuncs.com/alpaca/202508/28/20/68b047bd88bce5a6cd4c462e.m4a', '那你就是没有授权，没有授权麦克风。', 1958005652102651906, '2025-08-28 20:12:46');
INSERT INTO `chat_voice` VALUES (1961039419058216961, 'https://lxim.oss-cn-shenzhen.aliyuncs.com/alpaca/202508/28/20/68b047e588bce5a6cd4c462f.m4a', '他开始弹出来的时候，你就要点，或者是你点不点，打电话过来的时候，他应该会弹出来的，弹出来你就确定，然后挂断，然后再拨他就授权了。', 1958005652102651906, '2025-08-28 20:13:27');
INSERT INTO `chat_voice` VALUES (1961039497374261249, 'https://lxim.oss-cn-shenzhen.aliyuncs.com/alpaca/202508/28/20/68b047f888bce5a6cd4c4630.m4a', '要不你就找到那个应用，把那个麦克风勾上，不行，最简单的办法，不行你就把它卸了重装重装，然后它弹出来的时候你授权就可以了。', 1958005652102651906, '2025-08-28 20:13:45');
INSERT INTO `chat_voice` VALUES (1961039960714829825, 'https://lxim.oss-cn-shenzhen.aliyuncs.com/alpaca/202508/28/20/68b0486688bce5a6cd4c4631.m4a', '这个互相之间沟通方便一点，有什么都可以说。还有就是。打语音，打视频都可以有，我有个有点想法，准备跟你聊一下。', 1958005652102651906, '2025-08-28 20:15:36');
INSERT INTO `chat_voice` VALUES (1961348192062672898, 'https://lxim.oss-cn-shenzhen.aliyuncs.com/alpaca/202508/29/16/68b1677788bc7437d7c951a0.m4a', '你等一下，你等一下我再上传。要换一个地址，那一个苹果没办法发布。没有签名。', 1958005652102651906, '2025-08-29 16:40:24');
